Mercury also allows you to query events given certain topics. For instance, let's index all transfer events in our subscription to the address GAHLLHMKSCZL4BQDS37KIRUXJVZBWOKQMHA5YOZIS52UOKAEW22YDSXX: query MyQuery { eventByTopic( t1: "AAAADwAAAAh0cmFuc2Zlcg==" t3: "AAAAEgAAAAAAAAAADrWdipCyvgYDlv6kRpdNchs5UGHB3Dsol3VHKAS2tYE=" ) { edges { node { contractId data ledger ledgerTimestamp topic1 topic2 topic3 topic4 } } }
} sample response: { "data": { "eventByTopic": { "edges": [ { "node": { "contractId": "CDLZFC3SYJYDZT7K67VZ75HPJVIEUVNIXF47ZG2FB2RMQQVU2HHGCYSC", "data": "AAAACgAAAAAAAAAAAAAAAAX14QA=", "ledger": 1978025, "ledgerTimestamp": 1697132038, "topic1": "AAAADwAAAAh0cmFuc2Zlcg==", "topic2": "AAAAEgAAAAAAAAAAlgxjlS3RNgkTERctfeiCrlUtOyt9BCzR4tRDDY9zmIE=", "topic3": "AAAAEgAAAAAAAAAADrWdipCyvgYDlv6kRpdNchs5UGHB3Dsol3VHKAS2tYE=", "topic4": "AAAADgAAAAZuYXRpdmUAAA==" } } ] } }
} Note: this assumes that you already know the exact structure of the events you're querying. In this example we know that topic1 (t1) holds the event kind (Symbol("transfer") in our case) and that topic3 (t3) holds an Address object for the public key GAHLLHMKSCZL4BQDS37KIRUXJVZBWOKQMHA5YOZIS52UOKAEW22YDSXX. Building these xdrs must be done by the client and can be easily done with the existing stellar xdr tooling.

